    let price = 0;
    const distance = Math.abs(Province_Origin.code - Province_Destination.code);
    const size = parseFloat(Width) + parseFloat(Height) + parseFloat(Length);

    if (size <= 40 && Weight <= 2) {
      if (distance <= 5) {
        price = 35;
      } else if (distance > 5) {
        price = 55;
      }
    } else if (size <= 75 && Weight <= 7) {
      if (distance <= 5) {
        price = 65;
      } else if (distance > 5) {
        price = 85;
      }
    } else if (size <= 105 && Weight <= 10) {
      if (distance <= 5) {
        price = 130;
      } else if (distance > 5) {
        price = 145;
      }
    } else if (size <= 120 && Weight <= 15) {
      if (distance <= 5) {
        price = 185;
      } else if (distance > 5) {
        price = 205;
      }
    } else if (size <= 150 && Weight <= 20) {
      if (distance <= 5) {
        price = 290;
      } else if (distance > 5) {
        price = 330;
      }
    } else if (size <= 280 && Weight <= 30) {
      if (distance <= 5) {
        price = 380;
      } else if (distance > 5) {
        price = 420;
      }
